import React from 'react'
import '../../../../node_modules/bootstrap/dist/css/bootstrap.css';
import '../../../../node_modules/font-awesome/css/font-awesome.min.css';
import '../CourseManager.css';

const CourseGridCardComponent = ({course, deleteCourse}) =>

    <div className="col-12 col-sm-6 col-md-4 col-lg-3 col-xl-2 card-body wbdv-grid">
      <h5 className="card-title">{course.title}</h5>
      <p className="card-text">Text here</p>
      <i className="fa fa-times" onClick={(event) => deleteCourse(course)} />
    </div>;

export default CourseGridCardComponent;
